064;z-index: 99;}.bp{position: absolute;top: 58%;left: 50%;transform: translate(-50%, -50%);z-index: 99;}.rain {position: absolute;left: 0;width: 100%;height: 100%;z-index: 82;}.rain.back-row {display: none;z-index: 81;bottom: 60px;opacity: 0.5;}.drop {position: absolute;bottom: 100%;width: 20px;height: 120px;pointer-events: none;animation: drop 0.5s linear infinite;z-index: 80;}@keyframes drop {0% {transform: translateY(0vh);}75% {transform: translateY(90vh);}100% {transform: translateY(90vh);}}.stem {width: 1px;height: 60%;margin-left: 7px;background: linear-gradient(to bottom, rgba(255, 255, 255, 0), rgba(255, 255, 255, 0.25));animation: stem 0.5s linear infinite;}@keyframes stem {0% {opacity: 1;}65% {opacity: 1;}75% {opacity: 0;}100% {opacity: 0;}}.splat {width: 15px;height: 10px;border-top: 2px dotted rgba(255, 255, 255, 0.5);border-radius: 50%;opacity: 1;transform: scale(0);animation: splat 0.5s linear infinite;display: none;}body.splat-toggle .splat {display: block;}@keyframes splat {0% {opacity: 1;transform: scale(0);}80% {opacity: 1;transform: scale(0);}90% {opacity: 0.5;transform: scale(1);}100% {opacity: 0;transform: scale(1.5);}}.splat-toggle {top: 20px;}.back-row-toggle {top: 90px;line-height: 12px;padding-top: 14px;}.single-toggle {top: 160px;}body.single-toggle .drop {display: none;}body.single-toggle .drop:nth-child(10) {display: block;}

</head>
<body>
<div class="rain front-row"></div>
<div class="rain back-row"></div>
<div><p class="text">404 </p>
    <a href="/" class="bp btn-primary btn">Back to page</a>
</div>

<script>
    function makeItRain() {
        document.querySelectorAll('.rain').forEach((rain) => {
           rain.innerHTML = '';
        });

        var increment = 0;
        var drops = "";
        var backDrops = "";

        while (increment < 100) {
            var randoHundo = (Math.floor(Math.random() * (98 - 1 + 1) + 1));
            var randoFiver = (Math.floor(Math.random() * (5 - 2 + 1) + 2));
            increment += randoFiver;
            drops += '<div class="drop" style="left: ' + increment + '%; bottom: ' + (randoFiver + randoFiver - 1 + 100) + '%; animation-delay: 0.' + randoHundo + 's; animation-duration: 0.5' + randoHundo + 's;"><div class="stem" style="animation-delay: 0.' + randoHundo + 's; animation-duration: 0.5' + randoHundo + 's;"></div><div class="splat" style="animation-delay: 0.' + randoHundo + 's; animation-duration: 0.5' + randoHundo + 's;"></div></div>';
            backDrops += '<div class="drop" style="right: ' + increment + '%; bottom: ' + (randoFiver + randoFiver - 1 + 100) + '%; animation-delay: 0.' + randoHundo + 's; animation-duration: 0.5' + randoHundo + 's;"><div class="stem" style="animation-delay: 0.' + randoHundo + 's; animation-duration: 0.5' + randoHundo + 's;"></div><div class="splat" style="animation-delay: 0.' + randoHundo + 's; animation-duration: 0.5' + randoHundo + 's;"></div></div>';
        }
        document.querySelector('.rain.front-row').innerHTML += drops;
        document.querySelector('.rain.back-row').innerHTML += backDrops;
    }
    document.addEventListener('DOMContentLoaded', () => {
        makeItRain();
    });
</script>
</body>
